import axios from 'axios';
import React from 'react';

export async function FetchData(){
    

    const url = "http://127.0.0.1:8000/api/stock_manager/";
    

    axios.get(url)
        .then(res =>{
            const response = res.data
        })

    const data = response.json();
    return data
}
